import React from 'react';
import '../styles.css';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="contact-info">
        <h2>Kontakt a umístění</h2>
        <p>
          <strong>Adresa:</strong> Husova, 513 01 Semily
        </p>
        <p>
          <strong>Telefon:</strong> 777 611 601
        </p>
        <p>
          <strong>Otevírací doba:</strong> Po – Čt: 9:00-22:00
          <br />
          Pá-So – 9:00-13:00
          <br />
          Ne – zavřeno
        </p>
      </div>
    </footer>
  );
};

export default Footer;
